import React from "react"
import styles from "Card.module.css"

class CardHeader extends React.Component {
  render() {
    const { image } = this.props;
    var style = { 
        backgroundImage: 'url(' + image + ')',
    };
    return (
      <header style={style} id={image} className="card-header">
        <h4 className="card-header--title">News</h4>
      </header>
    )
  }
}

class Button extends React.Component {
  render() {
    return (
      <button className ={[styles.button, styles.button-primary].join(" ")}>
        <i className="fa fa-chevron-right"></i> Find out more
      </button>
    ) 
  }
}

class CardBody extends React.Component {
  render() {
    return (
      <div className={styles.card-body}>
        <p className={styles.date}>{this.props.data.startDate}</p>
        <p classname={styles.date}>{this.props.date.endDate}</p>
        <h2>Emotions</h2>
        <p className={styles.body-content}>Happy: {this.props.data.happy}%</p>
        <p className={styles.body-content}>Sad: {this.props.data.sad}%</p>
        <p className={styles.body-content}>Angry: {this.props.data.angry}%</p>
        <p className={styles.body-content}>Disgust: {this.props.data.disgust}%</p>
        <p className={styles.body-content}>Surprised: {this.props.data.surprised}%</p>
        <p className={styles.body-content}>Fearfull: {this.props.data.fearfull}%</p>
        <p className={styles.body-content}>Neutral: {this.props.data.neutral}%</p>
      </div>
    )
  }
}

class Card extends React.Component {
  render() {
    return (
      <article className="card">
        <CardBody data = {this.props.data}/>
      </article>
    )
  }
}

export default Card
